import React from 'react'
import { Typography, Button } from '@equinor/eds-core-react'
import styled from 'styled-components'

const StyledHeroBanner = styled.div`
  background: #f7f7f7;
  display: grid;
  grid-template-areas:
    '. . .'
    '. intro .'
    '. illustration .';
  grid-template-columns: 2rem 1fr 2rem;
  grid-template-rows: 2rem min-content min-content;
  @media (min-width: 600px) {
    height: 36rem;
    padding: 2rem;
    grid-template-areas: '. intro . illustration .';
    grid-template-columns: 1rem auto 2rem 45% 1fr;
    grid-template-rows: 1fr;
  }
  @media (min-width: 1200px) {
    grid-template-columns: 4.5rem auto 2rem 45% 1fr;
  }
`
const Intro = styled.div`
  grid-area: intro;
  text-align: center;
  max-width: 420px;

  & > *:not(:first-child) {
    margin-top: 1rem;
    margin-bottom: 0;
  }

  @media (min-width: 600px) {
    align-self: center;
  }
`

const Illustration = styled.div`
  grid-area: illustration;
  /*  width: 100%; */
  max-width: 600px;
  @media (min-width: 600px) {
    align-self: center;
  }
`

const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
  @media (min-width: 600px) {
    justify-content: left;
  }
`

